import { Navigate, Outlet } from "react-router-dom";
import Mainpage from './pages/Mainpage'

const ProtectedRoutes = ({isAuth = false}) => {
  return isAuth ? <Outlet /> : <Navigate to="/" />;
};

export default ProtectedRoutes;
